const elements={cells:document.querySelectorAll(".bingo-cell"),toastContainer:document.getElementById("toastContainer"),twitchEmbed:document.getElementById("twitchEmbed"),nextStream:document.getElementById("nextStream")};window.onload=async function(){for(let e=0;e<elements.cells.length;e++)elements.cells[e].onclick=e=>{e.target.classList.toggle("filled")}};